const Content = (title) => {
  const content = lookup[title];
  if (content["type"] === "iframe") {
    return <iframe title={"video"} src={content["src"]}></iframe>;
  }
  if (content["type"] === "img") {
    return <img src={content["srx"]} alt="lol"></img>;
  }
  if (content["type"] === "textarea") {
    return <textarea></textarea>;
  }
};

export default Content;
